import Vue from 'vue';
import Router from 'vue-router';
Vue.use(Router);
export default new Router({
  routes: [{
    path: '/',
    redirect: '/dashboard'
  }, {
    path: '*',
    redirect: '/404'
  }, {
    path: '/',
    component: function component() {
      return import(
      /* webpackChunkName: "home" */
      "../components/common/Home.vue");
    },
    meta: {
      title: '自述文件'
    },
    children: [{
      path: '/dashboard',
      component: function component() {
        return import(
        /* webpackChunkName: "dashboard" */
        "../components/page/Dashboard.vue");
      },
      meta: {
        title: '系统首页'
      }
    }, {
      path: '/redis/management',
      component: function component() {
        return import("../components/page/redisManagement");
      },
      meta: {
        title: 'redis集群管理'
      }
    }, {
      path: '/redis/request',
      component: function component() {
        return import("../components/page/redisOperation");
      },
      meta: {
        title: 'redis操作'
      }
    }, {
      path: '/perm/groups',
      component: function component() {
        return import("../components/page/perm/groups");
      },
      meta: {
        title: '组设置'
      }
    }, {
      path: '/perm/users',
      component: function component() {
        return import("../components/page/perm/users");
      },
      meta: {
        title: '用户设置'
      }
    }, {
      path: '/rabbitmq/management',
      component: function component() {
        return import("../components/page/rabbitmqManagement");
      },
      meta: {
        title: 'rabbitmq集群管理'
      }
    }, {
      path: '/audit/login',
      component: function component() {
        return import("../components/page/audit/login");
      },
      meta: {
        title: '登录日志'
      }
    }, {
      path: '/audit/request',
      component: function component() {
        return import("../components/page/audit/request");
      },
      meta: {
        title: 'API请求日志'
      }
    }, {
      path: '/audit/dbcrud',
      component: function component() {
        return import("../components/page/audit/dbcrud");
      },
      meta: {
        title: '数据库日志'
      }
    }, {
      path: '/404',
      component: function component() {
        return import(
        /* webpackChunkName: "404" */
        "../components/page/404.vue");
      },
      meta: {
        title: '404'
      }
    }, {
      path: '/403',
      component: function component() {
        return import(
        /* webpackChunkName: "403" */
        "../components/page/403.vue");
      },
      meta: {
        title: '403'
      }
    }]
  }, {
    path: '/login',
    component: function component() {
      return import(
      /* webpackChunkName: "login" */
      "../components/page/Login.vue");
    },
    meta: {
      title: '登录'
    }
  }]
});
